import GenerateScormPage from './pages/generateScormPage';
import SecondStage from './pages/secondStage';
import FirstStage from './pages/firstStage';
import './App.css';
import React from 'react';
import {
  BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={FirstStage}/>
        <Route exact path="/second" component={SecondStage}/>

      </Switch>
    </Router>
  );
}

export default App;
